async function guideService() {
  await robot.userRequest('导引服务');
  const destination = await robot.ask('您想去哪里？');
  await robot.goto(destination);
  await new Promise(resolve => setTimeout(resolve, 5000));
  await robot.goto('接待区');
}

guideService();

